import React from "react";
import { Button } from "@mui/material";
import { Link, useNavigate } from "react-router-dom";

class NavbarLogin extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            authenticated: false,
            registered:false,
            registerpage:false,
            loginpage:true,
            token: null,
            email: "",
            password: "",
            userign: "",
            userFirst: "",
            userLast: "",
            error: "",
        }
    }


    render() {
        const {navigation} = this.props;
        return(
            <Button
                key="toLogin"
                sx={{ color: 'white', display: 'block', marginLeft: "auto" }}
            >Login</Button>
        )
    }
}

export default function(props) {
    const navigation = useNavigate();

    return <NavbarLogin {...props} navigation={navigation} />;
}
